export function maxMinNumber({
  value,
  decimales,
  min,
  max
}) {
  const num = Number(value.replace(",", "."));
  let numValidado = value;

  if (num < min) {
    numValidado = Math.max(num, min).toFixed(decimales).replace(".", ",");
  }

  if (num > max) {
    numValidado = Math.min(num, max).toFixed(decimales).replace(".", ",");
  }

  return numValidado;
}
